window.plugins["1577723723112x940641204980154400"] = {"human":"RepeatingGroup to Chat","dependencies":{"use_jquery":true},"plugin_elements":{"AAC":{"display":"RG | Reverse","property_applications":{"resizable":true},"add_is_visible":true,"fields":{"AAD":{"caption":"RepeatingGroups ID","name":"rgs","rank":0,"editor":"DynamicValue","value":"text","is_list":false,"default_val":"rg1, rg2"},"AAE":{"caption":"Group Cells ID","name":"cells","rank":1,"editor":"DynamicValue","value":"text","default_val":"cell1, cell2"}},"states":{"AAF":{"caption":"error","name":"error","value":"text","initialization_code":{"fn":"function(instance, properties) {\n    \n}"}}},"code":{"preview":{"fn":"function(instance, properties) {\n\n    \n}"},"initialize":{"fn":"function(instance, context) {\n\n    instance.data.status = 'ready';\n\n    instance.data.run = function (rgs, cells) {\n\n\n        function makeid(length) {\n            let result = '';\n            let characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';\n            let charactersLength = characters.length;\n            for (let i = 0; i < length; i++) {\n                result += characters.charAt(Math.floor(Math.random() * charactersLength));\n            }\n            return result;\n        }\n\n\n        try {\n\n\n            if (!rgs) {\n\n                throw new Error('Empty: rgs.')\n            }\n            if (!cells) {\n\n                throw new Error('Empty: cells.')\n            }\n\n            let rgs_id = rgs.split(',');\n            let cells_id = cells.split(',');\n\n\n            function removeEmpty(arr) {\n\n                if (Array.isArray(arr)) {\n\n                    let ar = [];\n\n                    for (let i = 0; i < arr.length; i++) {\n\n                        if (typeof arr[i] === 'string') {\n\n                            if (arr[i].trim() !== '') {\n\n                                ar.push(arr[i].trim())\n                            }\n                        }\n                    }\n\n                    return ar\n                }\n            }\n\n            rgs_id = removeEmpty(rgs_id);\n            cells_id = removeEmpty(cells_id);\n\n\n            function check(id) {\n\n                return (!!$(`#${id}`)[0])\n            }\n\n            function scale(ids, value) {\n\n                let id = makeid(5);\n\n                if (Array.isArray(instance.data.style_ids)) {\n\n                    instance.data.style_ids.push(id)\n                } else {\n\n                    instance.data.style_ids = [id]\n                }\n                \n\n                instance.canvas.append(`<style id=${id}> ${ids} {\n                    transform: scaleY(${value}) !important;\n                    -webkit-transform: scaleY(${value}) !important;\n                    -moz-transform: scaleY(${value}) !important;\n                    -o-transform: scaleY(${value}) !important;\n                    -ms-transform: scaleY(${value}) !important;\n                    }\n                </style>`)\n            }\n\n            function scrollDirectionRevers(arr) {\n\n                for (let i = 0; i < arr.length; i++) {\n\n                    $(function () {\n                        $(arr[i]).mousewheel(function (event, delta) {\n\n                            this.scrollTop += (delta * 30);\n                            event.preventDefault()\n                        })\n                    })\n                }\n            }\n\n            function apply(arr = [], scale_value, is_rg) {\n\n                let arr_ids = [];\n                let rgs_scroll = [];\n\n\n                for (let i = 0; i < arr.length; i++) {\n\n                    let cell = arr[i].trim();\n\n                    arr_ids.push(`#${cell}`);\n\n                    if (is_rg === true) {\n\n                        let valid = check(cell);\n\n                        if (valid) {\n\n                            rgs_scroll.push(`#${cell}`)\n                        }\n                    }\n                }\n\n                instance.data.arr_ids = arr_ids;\n\n                scale(arr_ids, scale_value);\n\n\n                if (rgs_scroll.length > 0) {\n\n                    scrollDirectionRevers(rgs_scroll)\n                }\n            }\n\n            apply(rgs_id, -1, true);\n            apply(cells_id, -1, false);\n\n            return {\n                rgs: rgs_id,\n                cells: cells_id,\n            }\n        } catch (e) {\n\n            instance.publishState('error', e.message)\n        }\n    }\n}"},"update":{"fn":"function(instance, properties, context) {\n    \n    \n    try {\n\n        if (Array.isArray(instance.data.style_ids)) {\n\n            for (let i = 0; i < instance.data.style_ids.length; i++) {\n\n                $(`#${instance.data.style_ids[i]}`).remove()\n            }\n\n            instance.data.style_ids = []\n        }\n\n    } catch (e) {\n        \n        console.log(e.message)\n    }\n\n    typeof instance.data.status === 'string' ? instance.data.status === 'ready' ? instance.data.run(properties.rgs, properties.cells) : null : null\n}"},"reset":{"fn":"function(instance, context) {\n\n\n\n}"}},"platform_type":"web"}}};
